import style from './MainBox3.module.css'

import cup from '../images/cup'


function MainBox3() {
    let load = true

    setTimeout(() => {
        load = false
    }, 2000);

    return(

        <div className={style.box}>
            <img src={cup} />
            <button>Load Data</button>
            <p>These are some texts</p>
           <p>Amazon cup,</p> 
            <p>The best product provided.</p>


          {load && <p className={style.load}>nothing</p> }


        </div>
    )
}
export default MainBox3
